import styled from 'styled-components';

const BackButtonContainer = styled.div`
  width: 57px;
  height: 52px;
  position: absolute;

  top: 10px;
  left: 10px;

  img {
    width: 100%;
  }
  a {
    text-decoration: none;
    color: inherit;
  }
`;

export { BackButtonContainer };
